// ===========================
// Import React
// ===========================
import React from "react";

// ===========================
// Import chef images (from same folder, lowercase filenames)
// ===========================
import Chef1 from "./chef1.jpg";
import Chef2 from "./chef2.jpg";
import Chef3 from "./chef3.jpg";
import Chef4 from "./chef4.jpg";
import Chef5 from "./chef5.jpg"; // optional fifth chef if needed

// ===========================
// ChefGrid component
// ===========================
export default function ChefGrid() {
  return (
    <section className="chef-grid container">
      {/* Grid heading */}
      <h2>Meet Our Chefs</h2>

      {/* Chef cards container */}
      <div className="chef-cards" style={{
        display: "flex",
        flexWrap: "wrap",
        justifyContent: "space-between",
        gap: "24px"
      }}>
        {/* Chef 1 */}
        <div className="chef-card" style={{ flex: "1 1 220px" }}>
          <img src={Chef1} alt="Maria" />
          <h3>Maria</h3>
          <p>Expert in Italian cuisine and fresh flavors.</p>
        </div>

        {/* Chef 2 */}
        <div className="chef-card" style={{ flex: "1 1 220px" }}>
          <img src={Chef2} alt="Marcus" />
          <h3>Marcus</h3>
          <p>Grilling master and farm-to-table specialist.</p>
        </div>

        {/* Chef 3 */}
        <div className="chef-card" style={{ flex: "1 1 220px" }}>
          <img src={Chef3} alt="Luis" />
          <h3>Luis</h3>
          <p>Pastry chef creating unforgettable desserts.</p>
        </div>

        {/* Chef 4 */}
        <div className="chef-card" style={{ flex: "1 1 220px" }}>
          <img src={Chef4} alt="Ana" />
          <h3>Ana</h3>
          <p>Seafood expert bringing ocean flavors to life.</p>
        </div>

        {/* Optional Chef 5 */}
        {Chef5 && (
          <div className="chef-card" style={{ flex: "1 1 220px" }}>
            <img src={Chef5} alt="Chef 5" />
            <h3>Chef 5</h3>
            <p>Description for Chef 5.</p>
          </div>
        )}
      </div>
    </section>
  );
}
